import React, { Component } from 'react';
import { ImageWord } from './ImageWord';

export class HomeUser extends Component {

    render() {
        
        console.log('Lodding Image');
        return <div>
            {ImageWord.map(listImageWord => <p key={listImageWord.name}>{`${listImageWord.name} ${listImageWord.age}`}</p>)}
        </div>
    }
}
